description:
This is some of my vintage work, back when I really was a secret owl. Recorded with toothpicks, clay, and old cotton a year ago, in an old family cabin hide-a-way.

It&amp;#039;s interesting to see how I&amp;#039;ve progressed since those days.

No longer am I meek! I have made things, and they have made me! 


